// The Deferred Guard
void reactor_deregister(reactor *r, int fd) {
fd_handler *h = &r->handlers[fd];
if (r->dispatching) {
h->zombie = true; // Mark for skip
enqueue_mod(r, MOD_DEL, fd, 0); // Queue for later
} else {
h->registered = false;
epoll_ctl(r->epoll_fd, EPOLL_CTL_DEL, fd, NULL);
}
}
